ing","Memoization","Optimization"]},{questionText:"What is the time complexity of the following sorting algorithms: Bubble Sort, Merge Sort, Quick Sort?",options:["Bubble Sort: O(n log n), Merge Sort: O(n log n), Quick Sort: O(n log n)","Bubble Sort: O(n^2), Merge Sort: O(n log n), Quick Sort: O(n log n)","Bubble Sort: O(n), Merge Sort: O(n log n), Quick Sort: O(n log n)","Bubble Sort: O(n^2), Merge Sort: O(n), Quick Sort: O(n log n)"],answer:"Bubble Sort: O(n^2), Merge Sort: O(n log n), Quick Sort: O(n log n)",tag:["Sorting","Time Complexity","Bubble Sort","Merge Sort","Quick Sort"]},{questionText:"What is the difference between a linked list and an array in terms of memory allocation?",options:["Linked lists allocate memory dynamically, while arrays allocate memory statically","Linked lists allocate memory contiguously, while arrays allocate memory non-contiguously","Linked lists use pointers to store data, while arrays use indices","Linked lists are more efficient for searching, while arrays are more efficient for insertion and deletion"],answer:"Linked lists allocate memory dynamically, while arrays allocate memory statically",tag:["Linked List","Array","Memory Allocation"]},{questionText:"What is the purpose of a hash table in computer science?",options:["To store data in a sorted order for efficient searching","To provide a fast and efficient way to store and retrieve data based on a key","To implement a stack data structure for efficient function call management","To represent a graph data structure for efficient path finding"],answer:"To provide a fast and efficient way to store and retrieve data based on a key",tag:["Hash Table","Data Structures","Key-Value Storage"]},{questionText:"What is the difference between a process and a thread in operating systems?",options:["Processes are independent entities with their own memory space, while threads share the same memory space","Processes are lightweight and share resources, while threads are heavyweight and have their own resources","Processes are used for multitasking, while threads are used for multithreading","Processes are created using the fork() system call, while threads are created using the pthread_create() function"],answer:"Processes are independent entities with their own memory space, while threads share the same memory space",tag:["Process","Thread","Operating System"]},{questionText:"In a relational database, what is the purpose of a foreign key constraint?",options:["To ensure that the data in a table is unique","To define a relationship between two tables by referencing a primary key in another table","To enforce data integrity by preventing the insertion of duplicate values","To optimize query performance by creating indexes on frequently accessed columns"],answer:"To define a relationship between two tables by referencing a primary key in another table",tag:["Relational Database","Foreign Key","Data Integrity"]},{questionText:"What is the difference between a static variable and a dynamic variable in programming?",options:["Static variables are declared within a function, while dynamic variables are declared outside a function","Static variables have a fixed memory address, while dynamic variables have a memory address that can change","Static variables are allocated on the stack, while dynamic variables are allocated on the heap","Static variables retain their value between function calls, while dynamic variables do not"],answer:"Static variables retain their value between function calls, while dynamic variables do not",tag:["Static Variable","Dynamic Variable","Variable Scope"]},{questionText:"What is the purpose of a mutex in multithreaded programming?",options:["To ensure that only one thread can access a shared resource at a time","To allow multiple threads to access a shared resource concurrently","To synchronize the execution of multiple threads by allowing them to wait for each other","To communicate data between different threads by passing messages"],answer:"To ensure that only one thread can access a shared resource at a time",tag:["Mutex","Multithreading","Synchronization"]},{questionText:"What is the difference between a TCP connection and a UDP connection?",options:["TCP is a connection-oriented protocol, while UDP is a connectionless protocol","TCP provides reliable data delivery, while UDP does not guarantee delivery","TCP is used for streaming applications, while UDP is used for real-time applications","TCP is more efficient than UDP, but it is also more complex"],answer:"TCP is a connection-oriented protocol, while UDP is a connectionless protocol",tag:["TCP","UDP","Network Protocols"]},{questionText:"What is the purpose of a virtual memory in operating systems?",options:["To provide a larger virtual address space than the physical memory available","To improve memory access speed by caching frequently used data","To manage the allocation of disk space for storing files","To implement a file system for organizing and accessing files"],answer:"To provide a larger virtual address space than the physical memory available",tag:["Virtual Memory","Operating System","Memory Management"]},{questionText:"In a graph, what is the difference between a depth-first search (DFS) and a breadth-first search (BFS)?",options:["DFS explores the graph in a depth-first manner, while BFS explores the graph in a breadth-first manner","DFS uses a stack to store the visited nodes, while BFS uses a queue","DFS is more efficient for finding the shortest path, while BFS is more efficient for finding all connected components","DFS is typically used for traversing a tree, while BFS is typically used for traversing a graph"],answer:"DFS explores the graph in a depth-first manner, while BFS explores the graph in a breadth-first manner",tag:["Graph","DFS","BFS","Search Algorithms"]},{questionText:"What is the difference between a compile-time error and a runtime error?",options:["Compile-time errors occur during the compilation p
